class ArticleResult {
  final List<ArticleBean>? data;
  final int? page;
  final int? pageCount;
  final int? status;
  final int? totalCounts;

  ArticleResult(this.data, this.page, this.pageCount, this.status, this.totalCounts);

  static ArticleResult fromMap(Map<String, dynamic> map) {
    ArticleResult articleBean = ArticleResult(
     map['data']!=null ? ([]..addAll(
       (map['data'] as List).map((o) => ArticleBean.fromMap(o))
     )) : null,
     map['page'],
     map['page_count'],
     map['status'],
     map['total_counts'],
    );
    return articleBean;
  }

  Map toJson() => {
    "data": data?.map((o)=>o.toJson()).toList(growable: false),
    "page": page,
    "page_count": pageCount,
    "status": status,
    "total_counts": totalCounts,
  }..removeWhere((k,v)=>v==null);
}

