class ArticleBean {
  final String? Id;
  final String? author;
  final String? category;
  final String? createdAt;
  final String? desc;
  final List<String>? images;
  final int? likeCounts;
  final String? publishedAt;
  final int? stars;
  final String? title;
  final String? type;
  final String? url;
  final int? views;

  ArticleBean(this.Id, this.author, this.category, this.createdAt, this.desc, this.images, this.likeCounts, this.publishedAt, this.stars, this.title, this.type, this.url, this.views);

  static ArticleBean fromMap(Map<String, dynamic> map) {
    ArticleBean dataBean = ArticleBean(
     map['_id'],
     map['author'],
     map['category'],
     map['createdAt'],
     map['desc'],
     map['images']!=null ? ([]..addAll(
       (map['images'] as List).map((o) => o.toString())
     )) : null,
     map['likeCounts'],
     map['publishedAt'],
     map['stars'],
     map['title'],
     map['type'],
     map['url'],
     map['views'],
    );
    return dataBean;
  }

  Map toJson() => {
    "_id": Id,
    "author": author,
    "category": category,
    "createdAt": createdAt,
    "desc": desc,
    "images": images,
    "likeCounts": likeCounts,
    "publishedAt": publishedAt,
    "stars": stars,
    "title": title,
    "type": type,
    "url": url,
    "views": views,
  }..removeWhere((k,v)=>v==null);
}